import Badge2IMG from "./intel.svg";
import Badge3IMG from "./plusnotenote+.svg";
import Badge4IMG from "./house.svg";
import Carousel1 from "./BGmain1.jpg";

export const Badges = () => {
  return (

    <div className="mx-12 -my-8 border pb-14">
      <div className="flex flex-wrap justify-center mx-10 my-12">
        {/* Slim Badge 1 */}
        <div className="sm:w-1/4  px-4">
          <div className="bg-white rounded-lg shadow-md text-center p-3">
            <img src={Badge1IMG} alt="Icon 1" className="w-10 mx-auto" />
            <h1 className="text-md mt-2">Guaranteed</h1>
            <p class="text-xs">LOREM IPSOM  LOREM IPSOM LOREM IPSOM LOREM IPSOM LOREM IPSOM  </p>

            <p></p>
          </div>
        </div>

        {/* Slim Badge 2 */}
        <div className=" sm:w-1/4 px-4">
          <div className="bg-white rounded-lg shadow-md text-center p-3">
            <img src={Badge2IMG} alt="Icon 2" className="w-10 mx-auto" />
            <h1 className="text-md mt-2">Services</h1>
            <p class="text-xs">LOREM IPSOM  LOREM IPSOM LOREM IPSOM LOREM IPSOM LOREM IPSOM  </p>
          </div>
        </div>

        {/* Slim Badge 3 */}
        <div className=" sm:w-1/4 px-4">
          <div className="bg-white rounded-lg shadow-md text-center p-3">
            <img src={Badge3IMG} alt="Icon 3" className="w-10 mx-auto" />
            <h1 className="text-md mt-2">Availability</h1>
            <p class="text-xs">LOREM IPSOM  LOREM IPSOM LOREM IPSOM LOREM IPSOM LOREM IPSOM  </p>

          </div>
        </div>

        {/* Slim Badge 4 */}
        <div className="  sm:w-1/4 px-4">
          <div className="bg-white rounded-lg shadow-md text-center p-3">
            <img src={Badge4IMG} alt="Icon 4" className="w-10 mx-auto" />
            <h1 className="mt-2 text-md">Based Here</h1>
            <p class="text-xs">LOREM IPSOM  LOREM IPSOM LOREM IPSOM LOREM IPSOM LOREM IPSOM  </p>

          </div>
        </div>
      </div>


      </div>
  );
};
export default Badges;
